import React,{useState,useEffect} from 'react';
var destinationObj = {};


function DynamicTable({tabledata}){
// get table column
 Object.assign(destinationObj, tabledata);
 console.log(destinationObj)
 const column = Object.keys(destinationObj[0]);
 // get table heading data
 const ThData =()=>{
    
     return column.map((data)=>{
         return <th key={data}>{data}</th>
     })
 }
// get table row data
const tdData =() =>{
   
     return destinationObj.map((data)=>{
       return(
           <tr>
                {
                   column.map((v)=>{
                       return <td>{data[v]}</td>
                   })
                }
           </tr>
       )
     })
}
useEffect(() => {
    DynamicTable({tabledata})
  },[])

  return (
      <table className="table">
        <thead>
         <tr>{ThData()}</tr>
        </thead>
        <tbody>
        {tdData()}
        </tbody>
       </table>
  )
}
export default DynamicTable;
